        {
            id: 1,
            username: 'Viva',
            email: 'happybird00@naver.com'
        },
        {
            id: 2,
            username: 'tester',
            email: 'tester@naver.com'
        },
        {
            id: 3,
            username: 'dongwook',
            email: 'wooksker'
        }
    ];
    return (
        <div>
            <User user={users[0]}/>
            <User user={users[0]}/>
            <User user={users[0]}/>
        </div>
    )
}

